import '../css/main.css';
import { useJoke } from '../context/jokeProvider';
import { useSearch } from '../context/searchProvider';

export default function Joke(){

    let {joke,category,setseejoke} = useJoke();
    let {jokeType} = useSearch();

    return(
        <div className="joke_card">
            <p onClick={setseejoke}>back</p>
            <div>
            <p className="joke_ref" >{`${jokeType.toUpperCase()} JOKES`}</p>

            <h3>{category.length === 0 ? "UNCATEGORIZED" : `${category[0].toUpperCase()} JOKE`}</h3>
             <p>
               {joke}
             </p>

            </div>

       </div>
    )

    }
